import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Event from './Event';
import App from './App';
import Location from './Location';
import Navigation from './Navigation';
import Body from './Body';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <Event name="Anuv" price="1000" date="20/12/2023" Location="Jaipur"/>
      <Event name="King" price="1500" date="09/12/2023" Location="Delhi"/>
      <Event name="Justin biber" price="3000" date="09/11/2023" Location="Goa"/>
      <Event name="Mc Stan" price="500" date="31/12/2023" Location="Mumbai"/>
      </React.StrictMode>
);
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
